import React from 'react';
import logo from './logo.svg';
import './App.css';

import {List, Header, Container} from 'semantic-ui-react';

class Topics extends React.Component{
  constructor(props){
    super(props)
  }

  componentDidMount(){
    fetch('/topics')
    .then(res => res.json())
    .then(a => this.setState({"topics":a['topics']}))
  }

  render() {

    return(
      <div>

      </div>
    )
  }
}

export default Topics;
